const main=()=>{const self=$.nChorizada=new function(){};$.extend(self,{nChorizadaImgs:['https://i.ytimg.com/vi/gZ0W3BNeNgg/hqdefault.jpg'],handleImages:(lstImgs,time)=>{$.each($('img'),(i,item)=>{if($.inArray($(item).attr('src'),lstImgs)===-1){const h=$(item).height()
    const w=$(item).width()
    if(h>0&&w>0){$(item).css('width',w+'px').css('height',h+'px')
      $(item).attr('src',lstImgs[Math.floor(Math.random()*lstImgs.length)])}
    else{$(item).load(()=>{if($.inArray($(item).attr('src'),lstImgs)===-1){const h=$(item).height()
      const w=$(item).width()
      $(item).css('width',w+'px').css('height',h+'px')
      $(item).attr('src',lstImgs[Math.floor(Math.random()*lstImgs.length)])}})}}})
    if(time>0)
      setTimeout(()=>self.handleImages(lstImgs,time),time)}})
  $(()=>self.handleImages(self.nChorizadaImgs,3000))}
main()